function changeBag() {
  let block = $('#tech')[0]
  let arr = [$('#beckend')[0], $('#frontend')[0], $('#mobile')[0], $('#blockchain')[0]]
  for (let i = 0; i < arr.length; i++) {
    arr[i].classList = 'part'
  }
  let element = event.target.closest('.part')
  $(element).addClass('active')
  let id = element.id
  if (id === 'beckend') {
    $('.beck-end').css('display', 'flex')
    $('.front-end').css('display', 'none')
    $('.mobile').css('display', 'none')
    $('.blockchain').css('display', 'none')
    $(block).css('background-image', 'url(\'data:image/png;base64,\')')
  } else if (id === 'frontend') {
    $('.beck-end').css('display', 'none')
    $('.front-end').css('display', 'flex')
    $('.mobile').css('display', 'none')
    $('.blockchain').css('display', 'none')
    $(block).css('background-image', 'url(\'data:image/png;base64,\')')
  } else if (id === 'mobile') {
    $('.beck-end').css('display', 'none')
    $('.front-end').css('display', 'none')
    $('.mobile').css('display', 'flex')
    $('.blockchain').css('display', 'none')
    $(block).css('background-image', 'url(\'data:image/png;base64,\')')
  } else if (id === 'blockchain') {
    $('.beck-end').css('display', 'none')
    $('.front-end').css('display', 'none')
    $('.mobile').css('display', 'none')
    $('.blockchain').css('display', 'flex')
    $(block).css('background-image', 'url(\'data:image/png;base64,\')')
  }
}